import React, { useState, useEffect } from 'react';
import { View, Image, ImageBackground, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import ComboBox from 'react-native-combobox';
//import { SelectList } from 'react-native-dropdown-select-list'
//import { Dropdown } from 'react-native-element-dropdown';


import styles from './estilo';

export default function tCadastrarInfo() {

    const [cep, setsep] = useState("");
    const [endereco, setendereco] = useState("");
    const [cidade, setcidade] = useState("");
    const [estado, setestado] = useState("");
    
    const estados = [
        { id: 1, nome: 'Acre' },
        { id: 2, nome: 'Alagoas' },
        { id: 3, nome: 'Amapá' },
        { id: 4, nome: 'Amazonas' },
        { id: 5, nome: 'Bahia' },
        { id: 6, nome: 'Ceará' },
        { id: 7, nome: 'Distrito Federal' },
        { id: 8, nome: 'Espírito Santo' },
        { id: 9, nome: 'Goiás' },
        { id: 10, nome: 'Maranhão' },
        { id: 11, nome: 'Mato Grosso' },
        { id: 12, nome: 'Mato Grosso do Sul' },
        { id: 13, nome: 'Minas Gerais' },
        { id: 14, nome: 'Pará' },
        { id: 15, nome: 'Paraíba' },
        { id: 16, nome: 'Paraná' },
        { id: 17, nome: 'Pernambuco' },
        { id: 18, nome: 'Piauí' },
        { id: 19, nome: 'Rio de Janeiro' },
        { id: 20, nome: 'Rio Grande do Norte' },
        { id: 21, nome: 'Rio Grande do Sul' },
        { id: 22, nome: 'Rondônia' },
        { id: 23, nome: 'Roraima' },
        { id: 24, nome: 'Santa Catarina' },
        { id: 25, nome: 'São Paulo' },
        { id: 26, nome: 'Sergipe' },
        { id: 27, nome: 'Tocantins' },
    ];


    const navigation = useNavigation();

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styles.container}>
            <View style={styles.marginTop}>
                <Image style={{ width: 100, height: 109, marginTop: -30 }}
                    source={require('../../assets/logo.png')} />
            </View>

            <View>
                <Text style={styles.title}>Cadastro Cuidador</Text>
            </View>

            <ScrollView>
                <View style={styles.footer}>

                    <TextInput
                        style={styles.input}
                        value={cep}
                        placeholder="CEP"
                        onChangeText={(texto) => setendereco(texto)}
                    />

                    <Text style={styles.description}>Estado</Text>
                    <ComboBox
                        style={styles.input}
                        values={estados.map((estado) => estado.nome)}
                        onValueSelect={(texto) => {
                            const estadoSelecionado = estados.find((estado) => estado.nome === texto);
                            setestado(estadoSelecionado);}}
                        //onValueSelect={(texto) => setestado(texto)}
                    //onValueSelect={setestado}
                    />

                    <TextInput
                        style={styles.input}
                        placeholder="Cidade"
                        value={cidade}
                        onChangeText={(texto) => setcidade(texto)}
                    />

                    <TextInput
                        style={styles.input}
                        value={endereco}
                        placeholder="Endereço"
                        onChangeText={(texto) => setendereco(texto)}
                    />

                </View>
            </ScrollView>

            <View>
                <RectButton style={styles.buttonNext} onPress={() => navigation.navigate('tCadastroFotoC', {
                    nome: nome, celular: celular, cpf: cpf, cep: cep, endereco: endereco, estado: estado, email: email, senha: senha,
                })}>
                    <Text style={styles.buttonText}>Avançar</Text>
                </RectButton>

                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground >
    );
}
